import React from "react";
import s from './Navbar.module.css'
import {Link} from 'react-router-dom'


const Navbar=()=>{
    return (
    <nav className={s.nav}>
<a className={s.item}>
<Link to="/profile" className = { navData => navData.isActive ? s.active : s.item }>Profile</Link>
</a>
<a className={s.item}>
<Link to="/profile" className = { navData => navData.isActive ? s.active : s.item }>Profile</Link>
</a>
